  eval('module.exports = [\n	{\n		"id": 244942,\n		"title": "谈谈关于 qq 会员",\n		"url": "http://www.v2ex.com/t/244942",\n		"content": "这几天会员又要续费了，几年前还只有一种会员，近又出了个超级会员，小马哥真会玩啊，不过一直觉得开了会员纯属满足自己装 x 心理，并无卵用，\\r\\n\\r\\n\\r\\n各位开会员是为了什么？别告诉我是为了同步聊天记录",\n		"content_rendered": "这几天会员又要续费了，几年前还只有一种会员，近又出了个超级会员，小马哥真会玩啊，不过一直觉得开了会员纯属满足自己装 x 心理，并无卵用，\\r<br />\\r<br />\\r<br />各位开会员是为了什么？别告诉我是为了同步聊天记录",\n		"replies": 121,\n		"member": {\n			"id": 118502,\n			"username": "le0rn0",\n			"tagline": "",\n			"avatar_mini": "//cdn.v2ex.co/gravatar/bdf760cc3d482d8759ac2a9c269eeaf4?s=24&d=retro",\n			"avatar_normal": "//cdn.v2ex.co/gravatar/bdf760cc3d482d8759ac2a9c269eeaf4?s=48&d=retro",\n			"avatar_large": "//cdn.v2ex.co/gravatar/bdf760cc3d482d8759ac2a9c269eeaf4?s=73&d=retro"\n		},\n		"node": {\n			"id": 12,\n			"name": "qna",\n			"title": "问与答",\n			"title_alternative": "Questions and Answers",\n			"url": "http://www.v2ex.com/go/qna",\n			"topics": 61722,\n			"avatar_mini": "//cdn.v2ex.co/navatar/c20a/d4d7/12_mini.png?m=1448889637",\n			"avatar_normal": "//cdn.v2ex.co/navatar/c20a/d4d7/12_normal.png?m=1448889637",\n			"avatar_large": "//cdn.v2ex.co/navatar/c20a/d4d7/12_large.png?m=1448889637"\n		},\n		"created": 1450628415,\n		"last_modified": 1450664940,\n		"last_touched": 1450706911\n	},\n	{\n		"id": 244926,\n		"title": "准备逃离北京了",\n		"url": "http://www.v2ex.com/t/244926",\n		"content": "现在北京雾霾越来越严重了，治理也不是一年两年的事情。前几天冒出年后放弃北京，回家发展的想法。不知道有没有 v2exer 有跟我类似的想法，可以一起交流下？？\\r\\n\\r\\n我 07 年参加工作，在北京工作整整 8 年多，一直是从事开发相关的工作。老家没有计算机公司，如果回老家可能面临很多选择，一时之间拿不定主意。\\r\\n\\r\\n1. 转行\\r\\n把这些年工作的积蓄，投资到其他项目 或者 看看能不能考个公务员。\\r\\n\\r\\n2. 外包\\r\\n目前计算机外包给的钱不多，而且对于个人而言没有积累。\\r\\n\\r\\n3. 继续互联网创业\\r\\n之前跟过一个创业团队，知道创业的辛苦，另外创业成功的几率很小，特别是草根团队。\\r\\n\\r\\n4. soho 项目\\r\\n能找到 soho 的项目应该不多，而且我之前没做过，不知道有没有什么难度",\n		"content_rendered": "<p>现在北京雾霾越来越严重了，治理也不是一年两年的事情。前几天冒出年后放弃北京，回家发展的想法。不知道有没有 v2exer 有跟我类似的想法，可以一起交流下？？</p>\\n\\n<p>我 07 年参加工作，在北京工作整整 8 年多，一直是从事开发相关的工作。老家没有计算机公司，如果回老家可能面临很多选择，一时之间拿不定主意。</p>\\n\\n<ol>\\n<li><p>转行<br>\\n把这些年工作的积蓄，投资到其他项目 或者 看看能不能考个公务员。</p></li>\\n<li><p>外包<br>\\n目前计算机外包给的钱不多，而且对于个人而言没有积累。</p></li>\\n<li><p>继续互联网创业<br>\\n之前跟过一个创业团队，知道创业的辛苦，另外创业成功的几率很小，特别是草根团队。</p></li>\\n<li><p>soho 项目<br>\\n能找到 soho 的项目应该不多，而且我之前没做过，不知道有没有什么难度</p></li>\\n</ol>\\n",\n		"replies": 108,\n		"member": {\n			"id": 8392,\n			"username": "eric_zyh",\n			"tagline": "不干程序员就去做快递员",\n			"avatar_mini": "//cdn.v2ex.co/avatar/1d01/bd2e/8392_mini.png?m=1441448481",\n			"avatar_normal": "//cdn.v2ex.co/avatar/1d01/bd2e/8392_normal.png?m=1441448481",\n			"avatar_large": "//cdn.v2ex.co/avatar/1d01/bd2e/8392_large.png?m=1441448481"\n		},\n		"node": {\n			"id": 19,\n			"name": "beijing",\n			"title": "北京",\n			"title_alternative": "Beijing",\n			"url": "http://www.v2ex.com/go/beijing",\n			"topics": 994,\n			"avatar_mini": "/static/img/node_mini.png",\n			"avatar_normal": "/static/img/node_normal.png",\n			"avatar_large": "/static/img/node_large.png"\n		},\n		"created": 1450624857,\n		"last_modified": 1450640292,\n		"last_touched": 1450703308\n	},\n	{\n		"id": 244956,\n		"title": "读了那么多年书方才觉得最重要的是英语，其次是数学",\n		"url": "http://www.v2ex.com/t/244956",\n		"content": "",\n		"content_rendered": "",\n		"replies": 97,\n		"member": {\n			"id": 90666,\n			"username": "UtopiaCHN",\n			"tagline": "",\n			"avatar_mini": "//cdn.v2ex.co/avatar/22fd/a4de/90666_mini.png?m=1445272478",\n			"avatar_normal": "//cdn.v2ex.co/avatar/22fd/a4de/90666_normal.png?m=1445272478",\n			"avatar_large": "//cdn.v2ex.co/avatar/22fd/a4de/90666_large.png?m=1445272478"\n		},\n		"node": {\n			"id": 13,\n			"name": "idev",\n			"title": "iDev",\n			"title_alternative": "iDev",\n			"url": "http://www.v2ex.com/go/idev",\n			"topics": 2607,\n			"avatar_mini": "//cdn.v2ex.co/navatar/c51c/e410/13_mini.png?m=1450333358",\n			"avatar_normal": "//cdn.v2ex.co/navatar/c51c/e410/13_normal.png?m=1450333358",\n			"avatar_large": "//cdn.v2ex.co/navatar/c51c/e410/13_large.png?m=1450333358"\n		},\n		"created": 1450639349,\n		"last_modified": 1450639466,\n		"last_touched": 1450706942\n	},\n	{\n		"id": 245040,\n		"title": "骗子已经开始劫持银行的短信了么",\n		"url": "http://www.v2ex.com/t/245040",\n		"content": "本人有张建行的储蓄卡，上周收到一条短信，一看是个非主流域名 www.jo95533.us （只能用手机打开），知道是钓鱼的。这么直接劫持建行 95533 的短信怎么做到的。这种看上去来自“银行官方”的短信对用户非常危险啊。\\r\\n\\r\\n如图，上面的短信都是真实的，看最后一条。\\r\\n![Alt text]( http://ww2.sinaimg.cn/large/006fVPCvjw1ez76wj0atsj30u01hcwqc.jpg)\\r\\n\\r\\n钓鱼网站：\\r\\n![Alt text]( http://ww2.sinaimg.cn/large/006fVPCvjw1ez76uai6vnj30u01hcdy2.jpg)",\n		"content_rendered": "<p>本人有张建行的储蓄卡，上周收到一条短信，一看是个非主流域名 <a target=\\"_blank\\" rel=\\"nofollow\\" href=\\"http://www.jo95533.us\\">www.jo95533.us</a> （只能用手机打开），知道是钓鱼的。这么直接劫持建行 95533 的短信怎么做到的。这种看上去来自“银行官方”的短信对用户非常危险啊。</p>\\n\\n<p>如图，上面的短信都是真实的，看最后一条。<br>\\n<img src=\\"http://ww2.sinaimg.cn/large/006fVPCvjw1ez76wj0atsj30u01hcwqc.jpg\\" alt=\\"Alt text\\"></p>\\n\\n<p>钓鱼网站：<br>\\n<img src=\\"http://ww2.sinaimg.cn/large/006fVPCvjw1ez76uai6vnj30u01hcdy2.jpg\\" alt=\\"Alt text\\"></p>\\n",\n		"replies": 65,\n		"member": {\n			"id": 35700,\n			"username": "cozof",\n			"tagline": "",\n			"avatar_mini": "//cdn.v2ex.co/avatar/086a/6236/35700_mini.png?m=1363011616",\n			"avatar_normal": "//cdn.v2ex.co/avatar/086a/6236/35700_normal.png?m=1363011616",\n			"avatar_large": "//cdn.v2ex.co/avatar/086a/6236/35700_large.png?m=1363011616"\n		},\n		"node": {\n			"id": 557,\n			"name": "life",\n			"title": "生活",\n			"title_alternative": "Life",\n			"url": "http://www.v2ex.com/go/life",\n			"topics": 229,\n			"avatar_mini": "/static/img/node_mini.png",\n			"avatar_normal": "/static/img/node_normal.png",\n			"avatar_large": "/static/img/node_large.png"\n		},\n		"created": 1450673917,\n		"last_modified": 1450674269,\n		"last_touched": 1450703669\n	},\n	{\n		"id": 245053,\n		"title": "这是我对中国互联网最不理解的地方",\n		"url": "http://www.v2ex.com/t/245053",\n		"content": "作为一个程序员，每个人都希望自己得到尊重。从薪资待遇上，我比较满意。整个大环境，技术岗位的工资毫无疑问是最高的。但是中国根本没有技术驱动的公司，纯粹的产品、运营驱动，他们的数量是开发的两倍还多，可是这些人大多毫无经验，程序员在产品构思上没有话语权，产品都快上线了还要连夜改不靠谱的需求。产品、运营人员也很不爽，明明自己主导产品，工资却很低。",\n		"content_rendered": "<p>作为一个程序员，每个人都希望自己得到尊重。从薪资待遇上，我比较满意。整个大环境，技术岗位的工资毫无疑问是最高的。但是中国根本没有技术驱动的公司，纯粹的产品、运营驱动，他们的数量是开发的两倍还多，可是这些人大多毫无经验，程序员在产品构思上没有话语权，产品都快上线了还要连夜改不靠谱的需求。产品、运营人员也很不爽，明明自己主导产品，工资却很低。</p>\\n",\n		"replies": 63,\n		"member": {\n			"id": 29780,\n			"username": "eightqueen",\n			"tagline": "",\n			"avatar_mini": "//cdn.v2ex.co/avatar/70f0/e6d5/29780_mini.png?m=1430929741",\n			"avatar_normal": "//cdn.v2ex.co/avatar/70f0/e6d5/29780_normal.png?m=1430929741",\n			"avatar_large": "//cdn.v2ex.co/avatar/70f0/e6d5/29780_large.png?m=1430929741"\n		},\n		"node": {\n			"id": 56,\n			"name": "internet",\n			"title": "互联网",\n			"title_alternative": "Internet",\n			"url": "http://www.v2ex.com/go/internet",\n			"topics": 745,\n			"avatar_mini": "//cdn.v2ex.co/navatar/9f61/408e/56_mini.png?m=1448949997",\n			"avatar_normal": "//cdn.v2ex.co/navatar/9f61/408e/56_normal.png?m=1448949997",\n			"avatar_large": "//cdn.v2ex.co/navatar/9f61/408e/56_large.png?m=1448949997"\n		},\n		"created": 1450675124,\n		"last_modified": 1450705382,\n		"last_touched": 1450705984\n	},\n	{\n		"id": 244908,\n		"title": "台灯到底有没有辐射？辐射多大？如何计算呢？",\n		"url": "http://www.v2ex.com/t/244908",\n		"content": "![]( http://ww2.sinaimg.cn/large/a15b4afegw1ez6haueeaij21kw23u7wh.jpg)\\r\\n\\r\\n这是我的灯泡的规格，请问辐射大吗？",\n		"content_rendered": "<p><img src=\\"http://ww2.sinaimg.cn/large/a15b4afegw1ez6haueeaij21kw23u7wh.jpg\\" alt=\\"\\"></p>\\n\\n<p>这是我的灯泡的规格，请问辐射大吗？</p>\\n",\n		"replies": 61,\n		"member": {\n			"id": 120274,\n			"username": "ooTwToo",\n			"tagline": "",\n			"avatar_mini": "//cdn.v2ex.co/avatar/3cd6/3f45/120274_mini.png?m=1442589875",\n			"avatar_normal": "//cdn.v2ex.co/avatar/3cd6/3f45/120274_normal.png?m=1442589875",\n			"avatar_large": "//cdn.v2ex.co/avatar/3cd6/3f45/120274_large.png?m=1442589875"\n		},\n		"node": {\n			"id": 12,\n			"name": "qna",\n			"title": "问与答",\n			"title_alternative": "Questions and Answers",\n			"url": "http://www.v2ex.com/go/qna",\n			"topics": 61722,\n			"avatar_mini": "//cdn.v2ex.co/navatar/c20a/d4d7/12_mini.png?m=1448889637",\n			"avatar_normal": "//cdn.v2ex.co/navatar/c20a/d4d7/12_normal.png?m=1448889637",\n			"avatar_large": "//cdn.v2ex.co/navatar/c20a/d4d7/12_large.png?m=1448889637"\n		},\n		"created": 1450620772,\n		"last_modified": 1450620772,\n		"last_touched": 1450702606\n	},\n	{\n		"id": 245002,\n		"title": "大家都在论英语的重要性， That\'s why I wrote this app - QingDict for OSX",\n		"url": "http://www.v2ex.com/t/245002",\n		"content": "##首先...\\r\\n英语当然重要，词典是学英语最重要的工具\\r\\n\\r\\n##但是...\\r\\n我一直觉得，多数词典软件始终没摆脱“纸质词典电子化”这个思维局限。\\r\\n另外就是“划词取词”，我认为这主意“看似精美绝伦，实则愚不可及”，太烦人！\\r\\n至于 OSX 内置词典？太不接地气了！能用、但是一点也不好用。\\r\\n\\r\\n##所以...\\r\\n我决定写一个“轻量级、实用主义”的词典小程序, 它满足：\\r\\n * 触发方式必须简单自然\\r\\n * 必须真正帮助用户记住单词\\r\\n * UI 必须精简实用\\r\\n正好打算具体学习一下 Swift ，就写着练练手。\\r\\n\\r\\n##于是...\\r\\n * SITE: http://www.yingdev.com/projects/qingdict\\r\\n * REPO: https://github.com/yingDev/QingDict",\n		"content_rendered": "<h2>首先...</h2>\\n\\n<p>英语当然重要，词典是学英语最重要的工具</p>\\n\\n<h2>但是...</h2>\\n\\n<p>我一直觉得，多数词典软件始终没摆脱“纸质词典电子化”这个思维局限。<br>\\n另外就是“划词取词”，我认为这主意“看似精美绝伦，实则愚不可及”，太烦人！<br>\\n至于 OSX 内置词典？太不接地气了！能用、但是一点也不好用。</p>\\n\\n<h2>所以...</h2>\\n\\n<p>我决定写一个“轻量级、实用主义”的词典小程序, 它满足：<br>\\n * 触发方式必须简单自然<br>\\n * 必须真正帮助用户记住单词<br>\\n * UI 必须精简实用<br>\\n正好打算具体学习一下 Swift ，就写着练练手。</p>\\n\\n<h2>于是...</h2>\\n\\n<ul>\\n<li>SITE: <a target=\\"_blank\\" rel=\\"nofollow\\" href=\\"http://www.yingdev.com/projects/qingdict\\">http://www.yingdev.com/projects/qingdict</a></li>\\n<li>REPO: <a target=\\"_blank\\" rel=\\"nofollow\\" href=\\"https://github.com/yingDev/QingDict\\">https://github.com/yingDev/QingDict</a></li>\\n</ul>\\n",\n		"replies": 48,\n		"member": {\n			"id": 124939,\n			"username": "nozama",\n			"tagline": "",\n			"avatar_mini": "//cdn.v2ex.co/avatar/7df7/74cb/124939_mini.png?m=1437546029",\n			"avatar_normal": "//cdn.v2ex.co/avatar/7df7/74cb/124939_normal.png?m=1437546029",\n			"avatar_large": "//cdn.v2ex.co/avatar/7df7/74cb/124939_large.png?m=1437546029"\n		},\n		"node": {\n			"id": 17,\n			"name": "create",\n			"title": "分享创造",\n			"title_alternative": "Create",\n			"url": "http://www.v2ex.com/go/create",\n			"topics": 4789,\n			"avatar_mini": "//cdn.v2ex.co/navatar/70ef/df2e/17_mini.png?m=1447011026",\n			"avatar_normal": "//cdn.v2ex.co/navatar/70ef/df2e/17_normal.png?m=1447011026",\n			"avatar_large": "//cdn.v2ex.co/navatar/70ef/df2e/17_large.png?m=1447011026"\n		},\n		"created": 1450666970,\n		"last_modified": 1450682391,\n		"last_touched": 1450705472\n	},\n	{\n		"id": 244964,\n		"title": "现在还有人用 Pascal 编程吗？",\n		"url": "http://www.v2ex.com/t/244964",\n		"content": "## Pascal && Delphi\\r\\n\\t\\r\\n    用过 Delphi 的人都知道，组件化编程是有多么的爽，跟现在的 react 有相似的概念， pascal 编译器也是牛 X 的不行，当年也是跟 C 编译器齐名呀，可是自从安德斯·海尔斯伯格去了微软整了个 C#出来（这哥们真是厉害），似乎 pascal 就成了后妈的孩子，眼看 C#如日中天一天比一天得宠，却只能躲在角落里黯然神伤...\\r\\n    \\r\\n## 开源吗\\r\\n\\r\\n\\t我相信要是 pascal 开源，应该会在当今的开发大潮中能掀起一点波澜吧\\r\\n\\r\\n## 应用场景\\r\\n\\r\\n\\t我知道现在还有一部分人在使用着 pascal/delphi ，很想知道具体的应用开发场景是什么样的\\r\\n\\r\\n## 像初恋\\r\\n\\r\\n\\t我学的第一门语言是 Foxbase ，相当于是情窦初开吧，之后进入某公司维护学了 PowerBuilder ，为了吃饭不得不学，真正的热恋是和 Delphi ，一知半解的情况下，胡乱拖几个控件在窗体上，编译-运行，我去，好厉害啊\\r\\n    \\r\\n## 怀念\\r\\n\\r\\n\\t很怀念用 pascal 写代码的快感，编译速度和运行速度，以及碉堡了的兼容性（我在 2006 年写的程序到现在还能在 Win10 上运行，当年的承载开发的操作系统是 Win2000 ）。\\r\\n    \\r\\n给来点提示吧， Linux 或者 Win 下面，有用 pascal/delphi 开发的吗？你们都在开发什么？用的哪个 IDE （时下开发流行的），收入如何？（我市有一家招 Delphi 开发的貌似是建筑行业）",\n		"content_rendered": "<h2>Pascal &amp;&amp; Delphi</h2>\\n<div class=\\"highlight\\"><pre>用过 Delphi 的人都知道，组件化编程是有多么的爽，跟现在的 react 有相似的概念， pascal 编译器也是牛 X 的不行，当年也是跟 C 编译器齐名呀，可是自从安德斯·海尔斯伯格去了微软整了个 C#出来（这哥们真是厉害），似乎 pascal 就成了后妈的孩子，眼看 C#如日中天一天比一天得宠，却只能躲在角落里黯然神伤...\\n</pre></div>\\n\\n<h2>开源吗</h2>\\n<div class=\\"highlight\\"><pre>我相信要是 pascal 开源，应该会在当今的开发大潮中能掀起一点波澜吧\\n</pre></div>\\n\\n<h2>应用场景</h2>\\n<div class=\\"highlight\\"><pre>我知道现在还有一部分人在使用着 pascal/delphi ，很想知道具体的应用开发场景是什么样的\\n</pre></div>\\n\\n<h2>像初恋</h2>\\n<div class=\\"highlight\\"><pre>我学的第一门语言是 Foxbase ，相当于是情窦初开吧，之后进入某公司维护学了 PowerBuilder ，为了吃饭不得不学，真正的热恋是和 Delphi ，一知半解的情况下，胡乱拖几个控件在窗体上，编译-运行，我去，好厉害啊\\n</pre></div>\\n\\n<h2>怀念</h2>\\n<div class=\\"highlight\\"><pre>很怀念用 pascal 写代码的快感，编译速度和运行速度，以及碉堡了的兼容性（我在 2006 年写的程序到现在还能在 Win10 上运行，当年的承载开发的操作系统是 Win2000 ）。\\n</pre></div>\\n\\n<p>给来点提示吧， Linux 或者 Win 下面，有用 pascal/delphi 开发的吗？你们都在开发什么？用的哪个 IDE （时下开发流行的），收入如何？（我市有一家招 Delphi 开发的貌似是建筑行业）</p>\\n",\n		"replies": 46,\n		"member": {\n			"id": 64535,\n			"username": "zanpen2000",\n			"tagline": "",\n			"avatar_mini": "//cdn.v2ex.co/gravatar/c28c88fd7b51f2ccb384b8785cc171af?s=24&d=retro",\n			"avatar_normal": "//cdn.v2ex.co/gravatar/c28c88fd7b51f2ccb384b8785cc171af?s=48&d=retro",\n			"avatar_large": "//cdn.v2ex.co/gravatar/c28c88fd7b51f2ccb384b8785cc171af?s=73&d=retro"\n		},\n		"node": {\n			"id": 413,\n			"name": "programming",\n			"title": "编程",\n			"title_alternative": "Programming",\n			"url": "http://www.v2ex.com/go/programming",\n			"topics": 305,\n			"avatar_mini": "//cdn.v2ex.co/navatar/0deb/1c54/413_mini.png?m=1436505210",\n			"avatar_normal": "//cdn.v2ex.co/navatar/0deb/1c54/413_normal.png?m=1436505210",\n			"avatar_large": "//cdn.v2ex.co/navatar/0deb/1c54/413_large.png?m=1436505210"\n		},\n		"created": 1450657891,\n		"last_modified": 1450669799,\n		"last_touched": 1450699831\n	},\n	{\n		"id": 245071,\n		"title": "小米路由器在我关闭自动升级的情况下，强制升级了我的路由器，崩溃",\n		"url": "http://www.v2ex.com/t/245071",\n		"content": "我前几天从稳定版升级小米路由器到开发版，在路由器上做了大量的配置和修改，写了一些脚本。\\r\\n\\r\\n但是今天使用路由器的时候，路由器竟然升级成了稳定版。\\r\\n\\r\\n还敢用小米路由器吗？简直是强盗。",\n		"content_rendered": "我前几天从稳定版升级小米路由器到开发版，在路由器上做了大量的配置和修改，写了一些脚本。\\r<br />\\r<br />但是今天使用路由器的时候，路由器竟然升级成了稳定版。\\r<br />\\r<br />还敢用小米路由器吗？简直是强盗。",\n		"replies": 43,\n		"member": {\n			"id": 43792,\n			"username": "lijinma",\n			"tagline": "金马",\n			"avatar_mini": "//cdn.v2ex.co/gravatar/d7779435ee3a8b8dff22ce22446a7678?s=24&d=retro",\n			"avatar_normal": "//cdn.v2ex.co/gravatar/d7779435ee3a8b8dff22ce22446a7678?s=48&d=retro",\n			"avatar_large": "//cdn.v2ex.co/gravatar/d7779435ee3a8b8dff22ce22446a7678?s=73&d=retro"\n		},\n		"node": {\n			"id": 834,\n			"name": "xiaomi",\n			"title": "小米",\n			"title_alternative": "Xiaomi",\n			"url": "http://www.v2ex.com/go/xiaomi",\n			"topics": 68,\n			"avatar_mini": "//cdn.v2ex.co/navatar/301a/d0e3/834_mini.png?m=1422448760",\n			"avatar_normal": "//cdn.v2ex.co/navatar/301a/d0e3/834_normal.png?m=1422448760",\n			"avatar_large": "//cdn.v2ex.co/navatar/301a/d0e3/834_large.png?m=1422448760"\n		},\n		"created": 1450679154,\n		"last_modified": 1450685011,\n		"last_touched": 1450704660\n	}\n];//@ sourceMappingURL=data:application/json;base64,');
